import React from 'react'
import Login from '../../components/login/Login'
import { UserLoginContext } from '../../components/context/useContext'
function UserLogin() {
  return (
    <UserLoginContext.Provider>
    <>
    
      <Login />
    </>
    </UserLoginContext.Provider>
  )
}

export default UserLogin
